import './App.css';
import NavBar from './components/header/NavBar'
import Homepage from './pages/Homepage'
import Footer from './components/footer/Footer'
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      
      <NavBar />
      <Routes>
        <Homepage />
      <Footer />
      </Routes>
    </div>
  );
}

export default App;
